pragma solidity ^0.8.0;

contract SpyritRealmWLStaking is ReentrancyGuard, Ownable, ERC1155Holder {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.UintSet;

    string public constant name = "SpyritRealmWL";
    string public constant symbol = "SPYR";
    /* ========== STATE VARIABLES ========== */

    IERC20 public rewardsToken;
    uint256 public periodFinish = 0;
    uint256 public rewardRate = 0;
    uint256 public rewardsDuration = 5 days;
    uint256 public lastUpdateTime;
    uint256 public rewardPerTokenStored;
    address public immutable stakingNFTCollection;

    mapping(address => EnumerableSet.UintSet) private stakedNFTs;

    mapping(address => uint256) public userRewardPerTokenPaid;
    mapping(address => uint256) public rewards;
    mapping(address => uint256) public rewardsTotal;
    mapping(address => uint256) private tokens;

    uint256 private _totalSupply;
    mapping(address => uint256) private _balances;
    mapping(uint256 => address) private _stakings;


    /* ========== CONSTRUCTOR ========== */

    constructor(address _rewardsToken, address _stakingNFTCollection) {
        rewardsToken = IERC20(_rewardsToken);
        stakingNFTCollection = _stakingNFTCollection;
    }

    /* ========== VIEWS ========== */

    function totalSupply() external view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function tokenOfOwnerByIndex(address account, uint256 index) public view returns (uint256) {
        return stakedNFTs[account].at(index);
    }

    function tokensOfAccount(address account) external view returns(uint256[] memory ) {
        uint256 tokenCount = balanceOf(account);
        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 index;
            for (index = 0; index < tokenCount; index++) {
                result[index] = tokenOfOwnerByIndex(account, index);
            }
            return result;
        }
    }

    function lastTimeRewardApplicable() public view returns (uint256) {
        return Math.min(block.timestamp, periodFinish);
    }

    function rewardPerToken() public view returns (uint256) {
        if (_totalSupply == 0) {
            return rewardPerTokenStored;
        }
        return
            rewardPerTokenStored.add(
                lastTimeRewardApplicable().sub(lastUpdateTime).mul(rewardRate).mul(1e18).div(_totalSupply)
            );
    }

    function earned(address account) public view returns (uint256) {
        return
            _balances[account].mul(rewardPerToken().sub(userRewardPerTokenPaid[account])).div(1e18).add(
                rewards[account]
            );
    }

    function getRewardForDuration() external view returns (uint256) {
        return rewardRate.mul(rewardsDuration);
    }

    /* ========== MUTATIVE FUNCTIONS ========== */

    function stake(uint256 tokenId) external nonReentrant updateReward(msg.sender) {
        _totalSupply = _totalSupply.add(1);
        _balances[msg.sender] = _balances[msg.sender].add(1);
        stakedNFTs[msg.sender].add(tokenId);
        IERC1155(stakingNFTCollection).safeTransferFrom(msg.sender, address(this), tokenId, 1, "0x0");
        _stakings[tokenId] = msg.sender;
        emit Staked(msg.sender, tokenId);
    }

    function withdraw(uint256 tokenId) public nonReentrant updateReward(msg.sender) {
        require(_stakings[tokenId] == msg.sender, "Permission denied");
        _totalSupply = _totalSupply.sub(1);
        _balances[msg.sender] = _balances[msg.sender].sub(1);
        stakedNFTs[msg.sender].remove(tokenId);
        IERC1155(stakingNFTCollection).safeTransferFrom(address(this), msg.sender, tokenId, 1, "0x0");
        emit Withdrawn(msg.sender, tokenId);
    }

    function getReward() public nonReentrant updateReward(msg.sender) {
        uint256 reward = rewards[msg.sender];
        if (reward > 0) {
            rewards[msg.sender] = 0;
            rewardsToken.safeTransfer(msg.sender, reward);
            emit RewardPaid(msg.sender, reward);
        }
        rewardsTotal[msg.sender] = reward;
    }

    function exit(uint256 tokenId) external {
        withdraw(tokenId);
        if (_balances[msg.sender] == 0) {
            getReward();
        }
    }

    function exitAll() external {
        for (uint256 i; i <  stakedNFTs[msg.sender].length(); i++) {
            withdraw(stakedNFTs[msg.sender].at(i));
        } 
        getReward();
    }

    /* ========== RESTRICTED FUNCTIONS ========== */

    function notifyRewardAmount(uint256 reward) external onlyOwner updateReward(address(0)) {
        if (block.timestamp >= periodFinish) {
            rewardRate = reward.div(rewardsDuration);
        } else {
            uint256 remaining = periodFinish.sub(block.timestamp);
            uint256 leftover = remaining.mul(rewardRate);
            rewardRate = reward.add(leftover).div(rewardsDuration);
        }

        uint256 balance = rewardsToken.balanceOf(address(this));
        require(rewardRate <= balance.div(rewardsDuration), "Provided reward too high");

        lastUpdateTime = block.timestamp;
        periodFinish = block.timestamp.add(rewardsDuration);
        emit RewardAdded(reward);
    }

    function recoverERC20(address tokenAddress, uint256 tokenAmount) external onlyOwner {
        require(tokenAddress != address(rewardsToken), "Cannot withdraw the staking or rewards tokens");
        IERC20(tokenAddress).safeTransfer(owner(), tokenAmount);
        emit Recovered(tokenAddress, tokenAmount);
    }

    function setRewardsDuration(uint256 _rewardsDuration) external onlyOwner {
        require(
            block.timestamp > periodFinish,
            "Previous rewards period must be complete before changing the duration for the new period"
        );
        rewardsDuration = _rewardsDuration;
        emit RewardsDurationUpdated(rewardsDuration);
    }
    /* ========== MODIFIERS ========== */

    modifier updateReward(address account) {
        rewardPerTokenStored = rewardPerToken();
        lastUpdateTime = lastTimeRewardApplicable();
        if (account != address(0)) {
            rewards[account] = earned(account);
            userRewardPerTokenPaid[account] = rewardPerTokenStored;
        }
        _;
    }

    /* ========== EVENTS ========== */

    event RewardAdded(uint256 reward);
    event Staked(address indexed user, uint256 tokenId);
    event Withdrawn(address indexed user, uint256 tokenId);
    event RewardPaid(address indexed user, uint256 reward);
    event RewardsDurationUpdated(uint256 newDuration);
    event Recovered(address token, uint256 amount);
}

